import React from 'react'
import { useSelector } from 'react-redux'
import TattooCard from '../../TattooCard/TattooCard'

const UserImages = () => {
    const userImagesArray = useSelector((state: any) => state.images.userImages)
    userImagesArray.filter((image: any) => image.userName === localStorage.getItem("userName"))
    return (
        <div>
            {userImagesArray.filter((image: any) => image.userName === localStorage.getItem("userName"))}
            {/* {console.log(userImagesArray)} */}
        </div>
    )
}

export default UserImages
